// src/components/App.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [data, setData] = useState([]);
  const sheetId = '78425244'; // Replace with your actual sheet ID

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(`http://localhost:3001/api/get-records?sheet_id=${sheetId}`, {
          headers: {
            'Content-Type': 'application/json',
            'Authorization': 'Bearer C9B53439FA03FB946C93E9AC9963070B221EC0E3CD66399A',
          },
        });

        setData(response.data);
        console.log(response)
      } catch (error) {
        console.error('Error fetching data:', error.message);
      }
    };

    fetchData();
  }, [sheetId]);

  return (
    <div>
      <h1>Tigersheet API Example</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default App;
